```rust
fn draw_hexagon(draw: &Draw, radius: f32, position: Point2) {
    let num_points = 6;
    let angle = TAU \/ num_points as f32;

    let points = (0..num_points)
        .map(|i| {
            let a = i as f32 * angle;
            position + vec2(a.cos(), a.sin()) * radius
        })
