You can adjust the `tolerance` to define how close the colors need to be to be considered a match. A tolerance of 0 means the colors have to be exactly the same, whereas higher values allow for some variation between the colors.

Please note that this example uses a simple RGB comparison, which may not account for perceptual color differences. For more advanced color matching, you might want to look into color difference algorithms like CIE76, CIE94, CIEDE2000, or use libraries that implement these algorithms.

